        level = max(len(d1), len(d2))
    result = {}
    for key in d1:
        if key not in d2:
            result[key] = d1[key]
        elif type(d1[key]) != type(d2[key]):
            result[key] = d1[key]
        elif type(d1[key]) is dict:
            diff = difference(d1[key], d2[key], level-1)
            if diff:
