def find_roots(graph: "Graph", prop: "URIRef", roots: Optional[Set["Node"]] = None) -> Set["Node"]:
    if roots is None:
        roots = set()

    for s, p, o in graph.triples((None, prop, None)):
        if (s, p, o) not in roots:
