def find_roots(graph: "Graph", prop: "URIRef", roots: Optional[Set["Node"]] = None) -> Set["Node"]:
    if roots is None:
        roots = set()

    for node in graph.nodes():
        if not graph.predecessors(node, prop):
            roots.add(node)

    return roots

